import "./App.css";
import { logoSvg } from "./images/svg";

function App() {
  return (
    <div className="wrap">
      <header>
        <div className="header__logo">
          <svg className="header__logo_svg">
            <use href={logoSvg}></use>
          </svg>
        </div>
        <div className="header__shop"></div>
      </header>
    </div>
  );
}

export default App;
